import { Route, Routes } from "react-router-dom";
import StaffSalaryPage from "./pages/StaffSalaryPage";
import "./styles/App.css";

export default function App() {
  return (
    <div>
      <Routes>
        <Route path="/staffSalary" element={<StaffSalaryPage />} />
      </Routes>
    </div>
  );
}
